import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { CouriersService } from './couriers.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  public forecasts?: WeatherForecast[];

  couriers = {
    weight: number = 0,
    height: number,
    width: number,
    depth: number,
    published: false
  };
  submitted = false;



  constructor(http: HttpClient, private couriersService: CouriersService) {
    http.get<WeatherForecast[]>('/weatherforecast').subscribe(result => {
      this.forecasts = result;
    }, error => console.error(error));
  }
    ngOnInit(): void {
        throw new Error('Method not implemented.');
    }

  getPrice(): void {
    const data = {
      weight: this.couriers.weight,
      height: this.couriers.height,
      width: this.couriers.width,
      depth: this.couriers.depth,
    };

    this.couriersService.create(data)
      .subscribe(
          (        response: any) => {
          console.log(response);
          this.submitted = true;
        },
          (        error: any) => {
          console.log(error);
        });
  }

  newCourier(): void {
    this.submitted = false;
    this.couriers = {
      weight: 0,
      height: 0,
      width: 0,
      depth: 0,
      published: false
    };
  }


  title = 'angularapp';



}

interface WeatherForecast {
  date: string;
  temperatureC: number;
  temperatureF: number;
  summary: string;
}

interface OrderInputDetails {
  weight: number;
  height: number;
  width: number;
  depth: number;
}
<h1 id="tableLabel">Weather forecast</h1>

<p>This component demonstrates fetching data from the server.</p>

<p *ngIf="!forecasts"><em>Loading... Please refresh once the ASP.NET backend has started. See <a href="https://aka.ms/jspsintegrationangular">https://aka.ms/jspsintegrationangular</a> for more details.</em></p>

<table *ngIf="forecasts">
    <thead>
        <tr>
            <th>Date</th>
            <th>Temp. (C)</th>
            <th>Temp. (F)</th>
            <th>Summary</th>
        </tr>
    </thead>
    <tbody>
        <tr *ngFor="let forecast of forecasts">
            <td>{{ forecast.date }}</td>
            <td>{{ forecast.temperatureC }}</td>
            <td>{{ forecast.temperatureF }}</td>
            <td>{{ forecast.summary }}</td>
        </tr>
    </tbody>
</table>
<div style="width: 400px; margin: auto;">
  <div class="submit-form">
    <div *ngIf="!submitted">
      <div class="form-group">
        <label for="weight">Weight</label>
        <input type="text"
               class="form-control"
               id="weight"
               required
               [(ngModel)]="couriers.weight"
               name="weight" />
      </div>

      <div class="form-group">
        <label for="height">Height</label>
        <input type="text"
               class="form-control"
               id="height"
               required
               [(ngModel)]="couriers.height"
               name="height" />
      </div>
      <div class="form-group">
        <label for="width">Width</label>
        <input type="text"
               class="form-control"
               id="width"
               required
               [(ngModel)]="couriers.width"
               name="width" />
      </div>

      <div class="form-group">
        <label for="depth">Depth</label>
        <input class="form-control"
               id="depth"
               required
               [(ngModel)]="couriers.depth"
               name="depth" />
      </div>

      <button (click)="getPrice()" class="btn btn-success">Submit</button>
    </div>

    <div *ngIf="submitted">
      <h4>You submitted successfully!</h4>
      <button class="btn btn-success" (click)="newCourier()">Add</button>
    </div>
  </div>
</div>
